import React, { Component } from 'react'

export default class Edit extends Component {
    constructor(props) {
      super(props)

      this.state = {
         first:""
      }
    }
  render() {
    return (
      <div>
            <p>{this.props.data.id}</p>
            <p>{this.props.data.name}</p>
            <img src={this.props.data.avatar} alt="" />

      </div>
    )
  }
}
